import React from 'react';
import FirstComponent from "./CustomComponents/FirstComponent";
import './App.css'
import Card from './CustomComponents/Card'
import BillForm from './CustomComponents/NewBill/BillForm.js';
import FilterComponent from './CustomComponents/FilterComponent.js'

const App = () => {
  const expenses = [
    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(2020, 7, 14),
    },
    { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(2021, 2, 12) },
    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(2021, 2, 28),
    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      date: new Date(2021, 5, 12),
    },
  ];

  const finalprops = (props) => {
    console.log(props);
  }
  const YearHandler = (yearprops) => {
    console.log(yearprops)
  }
  return (<div>
    <FilterComponent onYearchange={YearHandler}/>
    <BillForm newbillform={finalprops}/>
    <Card className="expenses">
      <FirstComponent title= {expenses[1].title} amount={expenses[1].amount} date={expenses[1].date}  ></FirstComponent>
      <FirstComponent title= {expenses[2].title} amount={expenses[2].amount} date={expenses[2].date}></FirstComponent>
      <FirstComponent title= {expenses[3].title} amount={expenses[3].amount} date={expenses[3].date}></FirstComponent>
    </Card>
    </div>
  );
}

export default App;
